passage.text:
CONSIDERANDO que os casos de dispensa e inexigibilidade de licitacao, previstos nos 
arts. 24 e 25 da Lei no 8.666/1993, quando autorizados pela Diretoria Colegiada devem ser 
ratificados pelo Conselho de Administracao;
CONSIDERANDO que a Diretoria Colegiada da Terracap, por meio da Decisao no 1277, 
realizada em 16/09/2013, autorizou a contratacao direta da Empresa Instituto Alvorada Brasil 
de Arte, Cultura, Comunicacao e Cidadania;
CONSIDERANDO que o lapso temporal entre a data da reuniao da Diretoria Colegiada, 
realizada em 16/09/2013, e do Conselho de Administracao prevista para 20 de setembro de 
2013, nao atende o disposto no art. 26 da Lei no 8.666/1993;
CONSIDERANDO que o instrumento que se pretende firmar encontra-se juridicamente 
fundamentado em sua regencia legal;
DECIDE,
Por ato Ad referendum do Conselho de Administracao da TERRACAP, ratificar a 
Decisao no 1277 da Diretoria Colegiada, de 16/09/2013, que autorizou a contratacao 
direta por inexigibilidade de licitacao, da Empresa Instituto Alvorada Brasil de Arte, 
Cultura, Comunicacao e Cidadania;

Delega as competencias da Autoridade que menciona e da outras providencias 
O SECRETARIO DE ESTADO DE GOVERNO DO DISTRITO FEDERAL, no uso da 
atribuicao que lhe confere o inciso VII do Art. 105 da Lei Organica do Distrito Federal, e o 
Decreto no 32.716, de 1o de janeiro de 2011, RESOLVE:
Art. 1o Delegar competencia ao (a) Subsecretario (a) de Administracao Geral, da Secretaria 
de Estado de Governo do Distrito Federal para praticar os seguintes atos administrativos:
I  designar substitutos para os afastamentos e impedimentos legais de servidores ocupantes 
de cargo em comissao;
II  conceder, cessar, retificar, tornar sem efeito, homologar:
a) Auxilios e beneficios a servidores lotados na unidade e orgaos vinculados a Secretaria 
de Estado de Governo;
b) Aposentadoria;
c) Pensao a beneficiario de servidor;
d) Licenca-premio por assiduidade;
e) Licenca maternidade, adotante e paternidade; 
f) Licenca para o desempenho de mandato classista;
g) Licenca para tratar de interesses particulares;
h) Licenca para o servico militar; 
i) Licenca para atividade politica;
j) Licenca por motivo de doenca em pessoa da familia;
k) Licenca por motivo de afastamento do conjuge ou companheiro;
l) Abono de Permanencia;
III  conceder e mandar cessar Gratificacao de Apoio Administrativo;
IV  definir comissao para avaliar o desempenho, a aquisicao de estabilidade, homologar 
resultado do estagio probatorio e propor a progressao e promocao funcionais dos servidores;
V  dar exercicio a titulares de cargos efetivos e comissionados que lhe sao subordinados; 
VI  registrar, controlar, apurar, averbar e certificar o tempo de servico;
VII- lotar, redistribuir e remover servidores;
VIII- certificar e atestar ocorrencias relacionadas a vida funcional dos servidores;
IX  propor ao orgao responsavel a ampliacao para o regime de 40 horas semanais para o 
servidor, quando entender necessario, respeitando os limites orcamentarios, inclusive da Lei 
de Responsabilidade Fiscal  Lei Complementar 101, de 04 de maio de 2000 e fazer cessar 
a referida ampliacao quando oportuno ou atendendo a requerimento do servidor;
X  Converter a licenca-premio em pecunia;
XI  dispensar licitacao, e ou declarar a inexigibilidade de licitacao, nos termos da 
legislacao vigente.
XII  homologar e adjudicar licitacoes, na forma da legislacao vigente;

Paragrafo Unico - A Secretaria Executiva sera exercida pelo titular da Gerencia de Tecnologia 
da Informacao, ou, em sua ausencia, por seu suplente devidamente designado.
Art. 4o. Sao atribuicoes do Comite Gestor de Tecnologia da Informacao:
I  Elaborar seu Regimento Interno;
II - Estabelecer a politica e as diretrizes de Tecnologia da Informacao para a melhoria con-
tinua da gestao, em alinhamento a missao, as estrategias e as metas do Instituto;
III  Revisar, atualizar e aprovar os Planos Diretores de Tecnologia da Informacao  PDTI 
e o de Geoprocessamento  PDGeo;
IV - Analisar, supervisionar e priorizar, em conformidade com as politicas do IBRAM, seu 
PDTI e orcamento anual, o planejamento de aquisicoes, contratacoes e servicos de Tecno-
logia da Informacao e Comunicacao;
V - Estabelecer estrategias e diretrizes relacionadas a gestao dos recursos de informacao 
e tecnologias associadas, promover a sua implementacao e zelar pelo seu cumprimento;
VI - Propor a criacao de grupos de trabalho tecnicos para auxiliar as decisoes do Co-
mite, definindo seus objetivos, composicao e prazo para conclusao de seus trabalhos, 
quando for o caso;
VII - Monitorar os projetos de Tecnologia da Informacao e Comunicacao e resolver conflitos 
de recursos, prioridades ou estrategias;
VIII - Monitorar os niveis de servico de Tecnologia da Informacao e Comunicacao e 
suas melhorias.
Art. 5o Compete ao Comite Gestor de Tecnologia da Informacao:
I  Promover a integracao entre as estrategias organizacionais e as estrategias da area de 
Tecnologia da Informacao e Comunicacao;
II - Estabelecer as politicas de minimizacao de riscos, de priorizacao e distribuicao dos 
recursos orcamentarios;
III - Estabelecer e propor plano de investimento para a area de TI, inclusive quanto as 
aquisicoes de hardware e software;
IV - Recomendar adocao de metodologias de desenvolvimento de sistemas e inventario dos 
principais sistemas e base de dados;
V - Definir prioridades na formulacao e execucao de planos e projetos relacionados a TI;
VI - Formular, implementar e monitorar o processo de gestao de contratos de TI; 
VII - Implementar o gerenciamento do processo de contratacoes de bens e servicos de TI, 
com seus respectivos niveis de acordos de nivel de servico, aderindo ao que determina  a 
Instrucao Normativa no 04/2010 - SLTI.
Art. 6o O CGTI reunir-se-a, em carater ordinario, bimestralmente e extraordinaria-
mente, quando convocado por seu Presidente, por iniciativa propria ou por solicitacao 
dos seus membros.
Art. 7o Os casos omissos desta Instrucao serao decididos na forma do seu Regimento Interno.
Art. 8 Esta Instrucao entra em vigor na data de sua publicacao.
